  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:17.765172\",\n\t\"name\": \"bair-island-restoration-and-management-plan-existing-hydrologic-conditions-assessment\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The San Francisco Bay Wildlife Society
  is developing a Restoration and Management Plan for 3,200 acres of Federal and State
  lands on Bair Island, Redwood City, California (Figure 1). The plan includes restoration
  of 1,400 acres of inactive, leveed salt production ponds (\"salt ponds\") to tidal
  wetlands. This report provides background information on existing hydrologic conditions
  at Bair Island. This study was conducted by Philip Williams & Associates (PWA) for
  H.T. Harvey & Associates as part of planning and permitting assistance being provided
  to the San Francisco Bay Wildlife Society (Society) in support the  Bair Island
  Restoration and Management Plan. Bair Island is a former tidal marsh that currently
  consists of inactive salt ponds, former salt ponds restored  to tidal marsh, supra-tidal
  dredged material disposal areas, and remnant historic marsh (Figure 2). Bair Island
  is composed of three islands - Inner, Middle, and Outer Bair Islands - separated
  by tidal sloughs. The project study area includes the entire Restoration and Management
  Plan area (Figure 1), with particular emphasis on the 1,400 acres proposed for restoration.
  \ This study and the assessment of existing biological conditions being prepared
  concurrently by H.T. Harvey are the first of several in support of the Bair Island
  Restoration and Management Plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
